import React from 'react';

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
// import Blog from './component/Blog/Blog';
import BlogDetail from './component/blogViews/blogViews'; 
import Container from './component/tool/Container';
// import PropertySearchTool from './component/PropertySearchTool'; 
const App = () => {
  return (
    <Router>
      <Routes>
        {/* <Route path="/" element={<Blog />} /> */}
        <Route path="/blog/:id" element={<BlogDetail />} />
        <Route path="/" element={<Container />} />

        {/* <Route path="/propertySearchTool" element={<PropertySearchTool />} />  */}
      </Routes>
    </Router>
  );
};

export default App;



